//5.画布上绘制脸部信息
function drawFace(infobase64) {
	imgthis = new createjs.Bitmap(infobase64);

	var image = new Image();
	setTimeout(function() {

		//上传图片，实际宽度和高度
		image.src = infobase64;
		var imgWidth = image.width;
		var imgHeight = image.height;

		//设计稿预期宽度和位置
		var designWidth = 224; //脸部预期宽度
		var designX = 266; //脸部距左上角的X坐标 
		var designY = 625; //脸部距左上角的Y坐标 

		var sizescale = designWidth / elePos.w;

		var nowX = elePos.x * sizescale;
		var nowY = elePos.y * sizescale;

		var fx = designX - nowX;
		var fy = designY - nowY;

		elePos.s = sizescale;
		elePos.x = fx;
		elePos.y = fy;

		console.log(elePos)

		imgthis.scaleX = elePos.s, imgthis.scaleY = elePos.s, imgthis.rotation = elePos.a, imgthis.x = elePos.x, imgthis.y = elePos.y;
		stage.addChild(imgthis);
		stage.swapChildren(bg, imgthis);
		stage.update();
	}, 200)
}


//6.手势操作
//手势
var scale = 1,
	angle = 0,
	gestureArea = document.getElementById('gesture-area'); //手势区域

interact(gestureArea).gesturable({
	onstart: function(event) {

	},
	onmove: function(event) {
		if (typeof imgthis == 'undefined') {
			return
		}
		scale = scale * (1 + event.ds);
		angle += event.da;
		x = (parseFloat(elePos.x) || 0) + event.dx, y = (parseFloat(elePos.y) || 0) + event.dy;
		elePos.x = x;
		elePos.y = y;
		elePos.s = scale;
		elePos.a = angle;
		imgthis.scaleX = elePos.s, imgthis.scaleY = elePos.s, imgthis.rotation = elePos.a, imgthis.x = elePos.x, imgthis.y = elePos.y;

		stage.update();
	},
	onend: function(event) {}
}).draggable({
	onmove: dragMoveListener
});


function dragMoveListener(event) {
	if (typeof imgthis == 'undefined') {
		return
	}
	x = (parseFloat(elePos.x) || 0) + event.dx, y = (parseFloat(elePos.y) || 0) + event.dy;
	s = (parseFloat(elePos.s) || 1), a = (parseFloat(elePos.a) || 0);
	imgthis.scaleX = elePos.s, imgthis.scaleY = elePos.s, imgthis.rotation = elePos.a, imgthis.x = elePos.x, imgthis.y = elePos.y;
	elePos.x = x;
	elePos.y = y;
	stage.update();
}


